import React, { Component, useState, useEffect } from "react";
import { connect } from "react-redux";
import { fetchUser, updateUsers, deleteUsers } from "../redux";
// import React from 'react'
import { useLocation, useParams, Redirect } from "react-router-dom";
// const location = useLocation();
const initialState = {
  name: "",
  age: "",
  id: "",
};
function UserContainerDelete({ userData, fetchUser }, props) {
  const { id } = useParams();
  console.log(
    "params DAta",
    useParams(),
    userData,
    userData.name,
    userData.age
  );
  useEffect(() => {
    deleteUsers(id);
  }, []);

  const onSubmitData = (e) => {
    e.preventDefault();
    deleteUsers(id);
  };

  //   console.log("user======>", user.name, user.age);
  return <div></div>;
}

const mapStateToProps = (state) => {
  console.log("state", state);
  return {
    userData: state.users,
  };
};
export default connect(
  mapStateToProps,
  // mapDispatchToProps{}
  { updateUsers, fetchUser, deleteUsers }
)(UserContainerDelete);
